@JULIOC_HERRERA @SectorMovilidad Está bien el llamado, pero lamento decirle que su primer tuit, tiene el típico sesgo "culpa de la victima":
- El ciclista que usa la calzada es visto estorbo, invasor y hasta un suicida  
- El casco es la panacea y no usarlo es un problema para que se proteja al ciclista en vía
